import {  useEffect, useState } from 'react';
import OnBoarding from '../../SmartContracts/OnBoarding/OnBoarding';
import { HomeNav } from '../../component/Navbar/homeNav';
import { useNavigate } from 'react-router-dom';
import './LoadPrinter.css';


export default function LoadPrinter(){

    const [error,setError]=useState(false)
    const [errorMessage,SetErrorMessage]=useState('');
    let  printerData={"soluble":true,"foodSaety":true,"material":0};
    let onBoarding=new OnBoarding();


            /*if(window.ethereum){
                const accounts=await window.ethereum.request({ method: "eth_requestAccounts"} )
                if(accounts.length>0)
                    navigate('/')
                else
                    window.ethereum.request({ method: "eth_requestAccounts"} )*/





    const handleSubmit= async(event)=>{
        event.preventDefault();
        let result=checkError(printerData);
        if(result){
            console.log("webekbj")
            return}
        else {
            console.log("webekbj")
            await onBoarding.addPrinter(printerData);
        }

    }

    const checkError=async(printerData)=>{

        if(printerData['name'].match( /^[a-zA-Z0-9]+$/g)==null){
            setError(true);
            SetErrorMessage("The inserted character are not valid");
            return true;
        }
        else if(printerData['address'].length<10){
            setError(true);
            SetErrorMessage("Invalid address");   
            return true;
            //ALTRI CHECK SU ADDRESS PROVVISORIO
        }
        else return false;


    }       


    return (

        <div>
            <div className='sign'>
            <h1>Add printer</h1>
            <div className='SignIn'>
            <form  onSubmit={handleSubmit}>
                <label>
                    <p>Address</p>
                    <input type="text" name="address" onChange={event => printerData["address"]=event.target.value} autoComplete="off" required minLength="4" maxLength="32"></input>
                </label><br/>

                <label>
                    <p>Name</p>
                    <input type="text" name="username" onChange={event => printerData["name"]=event.target.value} autoComplete="off" required minLength="4" maxLength="10"></input>
                </label><br/>
                <label>
                <p>Material</p>
                    <select name="material" id="material" onClick={(e)=>printerData["material"]=e.target.value}>
                            <option value={0}>ABS</option>
                            <option value={1}>PLA</option>
                            <option value={2}>PETG</option>
                    </select>
                </label><br/>
                <label>
                <p>Nozzles</p>
                <input type="number" id="tentacles" name="tentacles"
                    min="1" max="100" onChange={event => {printerData["nozzles"]=event.target.value
                        console.log(printerData)}}/>


                </label><br/>
                <label>
                <p>Nozzles mounted</p>
                    <input type="number" id="tentacles" name="tentacles"
                        min="1" max="100" onChange={event => {printerData["nozzlesMount"]=event.target.value
                        console.log(printerData)}}/>

                </label><br/>

                <label>
                <p>Print Temperature</p>
                <input type="number" id="tentacles" name="tentacles"
                    min="1" max="100" onChange={event => {printerData["printerTemp"]=event.target.value
                    console.log(printerData)}}/>
                </label><br/>

                <label>
                <p>Bed Temperature</p>
                <input type="number" id="tentacles" name="tentacles"
                    min="1" max="100" onChange={event => {printerData["bedTemp"]=event.target.value
                    console.log(printerData)}}/>
                </label><br/>

                <label>
                <p>Volume</p>
                <input type="number" id="tentacles" name="tentacles"
                    min="10" max="100" onChange={event => {printerData["volume"]=event.target.value
                    console.log(printerData)}}/>
                </label><br/>

                <label>
                <p>soluble</p>
                    <select name="soluble" id="soluble" onClick={(e)=>printerData["soluble"]=e.target.value}>
                        <option value={true}>Yes</option>
                        <option value={false}>No</option>
                    </select>
                </label><br/>

                <label>
                <p>Food Safety</p>
                    <select name="food" id="food" onClick={(e)=>printerData["foodSafety"]=e.target.value}>
                    <option value={true}>Yes</option>
                    <option value={false}>No</option>
                </select>
                </label><br/>

                { error && <p className='error'>{errorMessage}</p>}

                <button className="SubmitButton" type='submit'>Sign in</button>



            </form>
            </div>

        </div>
        </div>


    )
}
